            "text": "[[[\"aspen\",\"aspen\",,,0],[,,,\"ËˆaspÉ™n\"]],,\"en\",,,,0.9285714,,[[\"en\"],,[0.9285714]],,,,[[\"noun\",[[\"a poplar tree with rounded, long-stalked, and typically coarsely toothed leaves that tremble in even a slight breeze.\",\"m_en_us1223299.001\",\"They prefer willows, maples, aspens , and poplars, and by preferentially choosing those species, they can have an important impact on the tree species composition of their communities.\"]],\"aspen\"]],[[[\"Even before the \\u003cb\\u003easpen\\u003c/b\\u003e and willows leaf out in the spring you'll see honeysuckles' green haze in abandoned fields and across wooded hillsides.\",,,,3,\"m_en_us1223299.001\"],[\"The stony soil below was covered by dense forests of live oak, Douglas fir, \\u003cb\\u003easpen\\u003c/b\\u003e , maple, ponderosa pine, madrone, Arizona cypress, and juniper.\",,,,3,\"m_en_us1223299.001\"],[\"Today's excess of elk and buffalo have destroyed woody species such as willow, \\u003cb\\u003easpen\\u003c/b\\u003e , cottonwood, alder and serviceberry along the streams and rivers.\",,,,3,\"m_en_us1223299.001\"],[\"The golden aspen, sometimes referred to as the quaking or trembling \\u003cb\\u003easpen\\u003c/b\\u003e , along with cottonwoods are responsible for the region's lemony landscapes.\",,,,3,\"m_en_us1223299.001\"],[\"Trees like \\u003cb\\u003easpen\\u003c/b\\u003e , poplar and birch actually have a very low flammability rate, according to the Fire Smart Web site.\",,,,3,\"m_en_us1223299.001\"],[\"What may follow in the path of the dead forest will likely be a mix of grasses and more hardwood trees like birch, \\u003cb\\u003easpen\\u003c/b\\u003e and alder.\",,,,3,\"m_en_us1223299.001\"],[\"Nests are usually built in deciduous trees, such as \\u003cb\\u003easpen\\u003c/b\\u003e , alder, cottonwood, or willow, but they may also be in firs or other conifers.\",,,,3,\"m_en_us1223299.001\"],[\"Valley after valley floats a handful of cottonwood and \\u003cb\\u003easpen\\u003c/b\\u003e trees in a dry ocean of sagebrush, the pale gray green running out the flats and over the hills.\",,,,3,\"m_en_us1223299.001\"],[\"I also suggested that it appeared to be blinking because she was looking at it through the fluttering leaves of an \\u003cb\\u003easpen\\u003c/b\\u003e tree.\",,,,3,\"m_en_us1223299.001\"],[\"The sun shone through the trees - red firs, junipers, lodgepole pines, \\u003cb\\u003easpens\\u003c/b\\u003e , and mountain hemlocks.\",,,,3,\"m_en_us1223299.001\"],[\"The trail they followed was lead by a small stream to their right, or to the north, while there left side was a light forest of trees that were no longer palm trees, but \\u003cb\\u003easpens\\u003c/b\\u003e and pine trees.\",,,,3,\"m_en_us1223299.001\"],[\"The willows and \\u003cb\\u003easpens\\u003c/b\\u003e were bursting out in young buds.\",,,,3,\"m_en_us1223299.001\"],[\"Rainy weather would bring out these beautiful plants in profusion under the firs, birches and \\u003cb\\u003easpens\\u003c/b\\u003e in our park, especially in its older part, east of the carriage road that divided the park in two.\",,,,3,\"m_en_us1223299.001\"],[\"In the spring, for example, clusters of connected \\u003cb\\u003easpens\\u003c/b\\u003e all grow their leaves back at the same time.\",,,,3,\"m_en_us1223299.001\"],[\"Surrounded by cottonwoods and \\u003cb\\u003easpens\\u003c/b\\u003e and featuring a wooden footbridge and an abundance of regional flora and foliage, it's a place to meditate, contemplate, and relax.\",,,,3,\"m_en_us1223299.001\"],[\"The three worked closely together to ensure that the new landscape would harmonize with a surrounding woodland of \\u003cb\\u003easpens\\u003c/b\\u003e , Douglas firs, ponderosa pines, and river birches.\",,,,3,\"m_en_us1223299.001\"],[\"Brilliant autumnal colors in areas where there are many deciduous trees, such as \\u003cb\\u003easpens\\u003c/b\\u003e and maples, result in paintings that are masses of yellow and orange.\",,,,3,\"m_en_us1223299.001\"],[\"The terrain steepens, climbing through a forest of conifers and \\u003cb\\u003easpens\\u003c/b\\u003e to Marker Hill.\",,,,3,\"m_en_us1223299.001\"],[\"They prefer willows, maples, \\u003cb\\u003easpens\\u003c/b\\u003e , and poplars, and by preferentially choosing those species, they can have an important impact on the tree species composition of their communities.\",,,,3,\"m_en_us1223299.001\"],[\"The thunderbird swooped low; even the bears in the nearby forest quaked at the sound, and the leaves on the \\u003cb\\u003easpens\\u003c/b\\u003e began to quiver, and they have not stopped to this day.\",,,,3,\"m_en_us1223299.001\"]]]]"
